import './App.css';

function About() {
  return (
    <div className="App">
        <h3> The Problem:</h3>
        <p> Healthcare costs are a big problem for the average person. It's hard to shop for services, and find pricing.</p>
        <p> Hospital Price Transparancy Law requires hospitals to post their prices, but 
            the machine readable file isn't consumer friendly, and 
            they only have to make 300 services 'easily' shoppable.</p>
        <h3> The Solution: </h3>
        <p> Aggregate the data from hospitals to create consumer friendly vizualisations of hospital pricing. </p>

    </div>
  );
}

export default About;
